import React from 'react';
import './Home.css';

const sportsData = [
  {
    name: 'BASKETBALL',
    image: 'https://th.bing.com/th/id/OIP.cQvq8fFRTbDZX7mJp7ACgQHaEb?rs=1&pid=ImgDetMain',
    description: 'Join our elite basketball program featuring professional coaching, state-of-the-art facilities, and competitive leagues.'
  },
  {
    name: 'CRICKET',
    image: 'https://th.bing.com/th/id/R.708143c9f90cec7aa9c0ceaa11a42aa7?rik=rZk8ew4MkqHItg&riu=http%3a%2f%2fp.imgci.com%2fdb%2fPICTURES%2fCMS%2f258800%2f258875.jpg&ehk=pCb3f6PUIU5vWs94EvmnQnIpQEA44g7STRCulesnadY%3d&risl=&pid=ImgRaw&r=0',
    description: 'Experience cricket at its finest with specialized training programs, modern pitches, and year-round tournaments.'
  },
  {
    name: 'FOOTBALL',
    image: 'https://www.descente.co.jp/media/wp-content/uploads/2020/10/shutterstock_517663504-min.jpg',
    description: 'Elevate your football skills with expert coaching, advanced training methods, and competitive matches.'
  },
  {
    name: 'VOLLEYBALL',
    image: 'https://th.bing.com/th/id/OIP.2xRk_xGsu8k4Z-HSDcWavwHaEM?rs=1&pid=ImgDetMain',
    description: 'Master volleyball techniques through intensive training programs and participate in regional championships.'
  },
  {
    name: 'SWIMMING',
    image: 'https://th.bing.com/th/id/OIP.b4evssGjmHqGhUktv8adhQHaE7?rs=1&pid=ImgDetMain',
    description: 'Dive into excellence with our Olympic-sized pool, certified instructors, and comprehensive aquatics program.'
  },
  {
    name: 'TENNIS',
    image: 'https://blog.playo.co/wp-content/uploads/2019/02/shutterstock_794204539.jpg',
    description: 'Perfect your serve on our professional courts with personalized coaching and regular tournaments.'
  }
];

const upcomingEvents = [
  {
    id: 1,
    title: "University Sports Championship 2024",
    date: "2024-05-10",
    time: "09:00",
    venue: "University Sports Complex",
    teams: "All University Teams",
    sport: "Multi-Sport Event"
  },
  {
    id: 2,
    title: "Summer Tennis Tournament",
    date: "2024-05-15",
    time: "10:00",
    venue: "Central Tennis Courts",
    teams: "16 Players Knockout",
    sport: "Tennis"
  },
  {
    id: 3,
    title: "Swimming Gala",
    date: "2024-05-20",
    time: "14:00",
    venue: "Olympic Pool Complex",
    teams: "Individual & Team Events",
    sport: "Swimming"
  }
];

const Home = () => {
  return (
    <div className="home-container">
      <div className="hero-section">
        <h1>ELEVATE YOUR GAME WITH SPORTSYNC</h1>
        <p>Your Ultimate Platform for Sports Excellence and Team Management</p>
      </div>

      <section className="sports-section">
        <h2 className="section-title">Popular Sports</h2>
        <div className="sports-grid">
          {sportsData.map((sport, index) => (
            <div key={index} className="sport-card">
              <div className="sport-image-container">
                <img src={sport.image} alt={sport.name} className="sport-image" />
              </div>
              <div className="sport-content">
                <h2>{sport.name}</h2>
                <p>{sport.description}</p>
              </div>
            </div>
          ))}
        </div>
      </section>

      <section className="events-section">
        <h2 className="section-title">Upcoming Events</h2>
        <div className="events-grid">
          {upcomingEvents.map((event) => (
            <div key={event.id} className="event-card">
              <div className="event-header">
                <h3>{event.title}</h3>
                <span className="event-sport">{event.sport}</span>
              </div>
              <div className="event-details">
                <div className="event-info">
                  <p><i className="far fa-calendar"></i> {event.date}</p>
                  <p><i className="far fa-clock"></i> {event.time}</p>
                  <p><i className="fas fa-map-marker-alt"></i> {event.venue}</p>
                </div>
                <p className="event-teams">{event.teams}</p>
              </div>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default Home;
